export const json = {
    "title": "Career Guidance Form",
    "logoPosition": "right",
    "pages": [
     {
      "name": "page1",
      "elements": [
       {
        "type": "text",
        "name": "Name",
        "title": "Enter your name:-",
        "isRequired": true
       },
       {
        "type": "text",
        "name": "question2",
        "title": "Enter your highest degree:-",
        "isRequired": true
       },
       {
        "type": "boolean",
        "name": "question1",
        "title": "Are you passionate about solving complex problems and designing innovative solutions?",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question8",
        "title": "Are you interested in pursuing a career that offers opportunities for growth, advancement, and lifelong learning?\r\n",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question3",
        "title": "Do you enjoy subjects like mathematics, physics, and chemistry?",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question4",
        "title": "Are you interested in understanding how things work and applying scientific principles to real-world problems?\r\n",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question5",
        "title": "Do you have strong analytical and problem-solving skills?",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question6",
        "title": "Are you fascinated by technology and its potential to drive innovation and change?",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question7",
        "title": "Are you comfortable with abstract thinking and logical reasoning?\r\n",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question9",
        "title": "Are you willing to put in the time and effort required to excel in a challenging academic program?\r\n",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question10",
        "title": "Are you interested in exploring different specializations within engineering, such as civil, mechanical, electrical, or computer engineering?\r\n",
        "valueTrue": "Yes",
        "valueFalse": "No"
       },
       {
        "type": "boolean",
        "name": "question11",
        "title": "Are you motivated to make a positive impact on society and contribute to solving global challenges through engineering solutions?\r\n\r\n",
        "valueTrue": "Yes",
        "valueFalse": "No"
       }
      ]
     }
    ]
   }
